import{_ as e,a as r,b as l,c as o,d as i,e as n,f as s}from"./chunks/qgc_firmware_standard_vtol_fun_cub_quad.Dw2D8p6U.js";import{_ as d,c as p,o as _,ab as a,m as t}from"./chunks/framework.CUflZczI.js";const R=JSON.parse('{"title":"Volantex Ranger-Ex QuadPlane VTOL (Pixhawk)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/frames_vtol/vtol_quadplane_volantex_ranger_ex_pixhawk.md","filePath":"uk/frames_vtol/vtol_quadplane_volantex_ranger_ex_pixhawk.md"}'),u={name:"uk/frames_vtol/vtol_quadplane_volantex_ranger_ex_pixhawk.md"},h=a('<h1 id="volantex-ranger-ex-quadplane-vtol-pixhawk" tabindex="-1">Volantex Ranger-Ex QuadPlane VTOL (Pixhawk) <a class="header-anchor" href="#volantex-ranger-ex-quadplane-vtol-pixhawk" aria-label="Permalink to &quot;Volantex Ranger-Ex QuadPlane VTOL (Pixhawk)&quot;">​</a></h1><p>QuadRanger VTOL - це стандартний повітряний літак з хвостовим оперенням на основі Volantex Ranger-Ex, який був модернізований з системою QuadCopter. Ranger-Ex є простою у виліті платформою FPV, яка широко доступна. Він також доступний в магазині HobbyKing, де він перевиданий як Quanum Observer. Пластиковий фюзеляж і 2-метрове крило EPO роблять його міцною конструкцією з величезним обсягом корисного навантаження.</p><p>Ключова інформація:</p><ul><li><strong>Рама:</strong> Volantex Ranger-Ex або <em>Quanum Observer</em></li><li><strong>Контролер польоту:</strong> Pixhawk</li></ul><p><img src="'+e+'" alt="QuadRanger"></p><p>Конверсія VTOL робить літак трохи важчим (близько 3,5 кг, включаючи LiPo). З цією конверсією літак буде летіти приблизно на 65% потужності двигуна. Запропонована чотирьохмоторна установка забезпечує тягу 7,5 кг, а конструкція повітряного каркасу може летіти з загальною вагою близько 4,5 кг. Це залишає достатньо потужності для вантажів, таких як обладнання для перегляду з першої особи та камери.</p><p>Конверсія призначена для мінімізації впливу на аеродинаміку та надання додаткової міцності для мінімізації згину крила.</p><h2 id="специфікація-матеріалів" tabindex="-1">Специфікація матеріалів <a class="header-anchor" href="#специфікація-матеріалів" aria-label="Permalink to &quot;Специфікація матеріалів&quot;">​</a></h2><ul><li>Volantex Ranger-Ex або Quanum Observer</li><li>1200KV 530W двигуни</li><li>Регулятори швидкості 30A</li><li>батарея 4s</li><li>Електричні гвинти APC 11x5</li></ul><h2 id="комплект-конверсіі" tabindex="-1">Комплект конверсії <a class="header-anchor" href="#комплект-конверсіі" aria-label="Permalink to &quot;Комплект конверсії&quot;">​</a></h2><ul><li>Необхідні основні частини;</li><li>Pixhawk або сумісний</li><li>Цифровий датчик швидкості польоту</li><li>Модуль живлення 3DR або сумісний</li><li>GPS</li></ul><p>Для повного списку частин з посиланнями на склади Hobbyking у Європі та міжнародні склади перегляньте: <a href="https://px4.io/wp-content/uploads/2016/01/QuadRanger-VTOL-partslist-1.xlsx" target="_blank" rel="noreferrer">Список частин QuadRanger-VTOL</a></p><p>Зображення нижче показує деталі, необхідні для одного крила.</p><p><img src="'+r+'" alt="QuadRanger Parts"></p><p>Необхідні інструменти для конвертації;</p><ul><li>Інструмент Dremel або подібний поворотний інструмент</li><li>Ніж для хобі</li><li>Клей UHU POR</li><li>Клей CA</li><li>Вимірювальний стрічка</li><li>Скотч</li></ul><p><img src="'+l+'" alt="QuadRanger conversion tools"></p><h2 id="конверсія-крила" tabindex="-1">Конверсія крила <a class="header-anchor" href="#конверсія-крила" aria-label="Permalink to &quot;Конверсія крила&quot;">​</a></h2><p>Повний журнал збірки наведено в наступному відео.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Зверніть увагу, що конверсія в цьому журналі компіляції виконується на крилі, яке показує пошкодження від попередньої конверсії.</p></div>',20),c=t("p",null,[t("div",{class:"embed-responsive embed-responsive-16by9"},[t("iframe",{class:"embed-responsive-item youtube-player",type:"text/html",width:"640",height:"390",src:"https://www.youtube.com/embed/l_ppJ_HhAUQ",frameborder:"0",webkitallowfullscreen:"",mozallowfullscreen:"",allowfullscreen:""})])],-1),m=a('<p>Відріжте обидва 800 мм квадратні вуглецеві труби до довжини 570 мм та 230 мм.</p><p>Виготовлення пазу у понівеченому крилі глибиною 1,5 см за допомогою обертаючого інструменту з якоюсь формою керівництва для збереження постійної глибини. Ящірка повинна мати довжину, глибину і ширину одного квадратного вуглецевого труби розміром 230 мм. Воно повинно бути розташоване так, як показано нижче.</p><p><img src="'+o+'" alt="QuadRanger carbon tube slot"></p><p>Приклейте вуглецевий лист розміром 300x150x1,5 мм до вуглецевої труби розміром 230 мм за допомогою клею CA та створіть отвір для прокладання проводів через нього. Вставте проводи для живлення та сигналу до ESC. Використовуючи клей UHU POR, приклейте лист і вуглепластикову трубку до крила з пінопласту, як показано нижче.</p><p><img src="'+i+'" alt="QuadRanger sheet attachment"></p><p>Використовуючи клей СА, заліпіть квадратну вуглецеву трубу довжиною 570 мм на вуглецевий лист. Воно повинно знаходитись на відстані 285 мм від місця приєднання крил. Трубка повинна бути центрована відносно вертикальної області крила. Він повинен розширюватися точно на 165 мм з обох сторін.</p><p>Прикріпіть кронштейн для двигуна до двигуна. З іншою пластиною кріплення двигуна та 4 гвинтами M3x25 мм закріпіть двигун на кінці квадратної вуглецевої труби, як показано нижче. Прикріпіть РЕБ зі стяжками до вуглецевої труби. Під час використання Afro ESC обов&#39;язково підключіть принаймні сигнальний та земельний провід.</p><p><img src="'+n+'" alt="QuadRanger motor and esc"></p><h2 id="підключення" tabindex="-1">Підключення <a class="header-anchor" href="#підключення" aria-label="Permalink to &quot;Підключення&quot;">​</a></h2><p>Виходи Pixhawk повинні бути підключені таким чином (орієнтація, як бачиться як &quot;сидячи в літаку&quot;).</p><table><thead><tr><th>Порт</th><th>З&#39;єднання</th></tr></thead><tbody><tr><td>MAIN 1</td><td>Передній правий мотор, CCW</td></tr><tr><td>MAIN 2</td><td>Задній лівий мотор, CCW</td></tr><tr><td>MAIN 3</td><td>Передній лівий мотор, CW</td></tr><tr><td>MAIN 4</td><td>Задній правий мотор, CW</td></tr><tr><td>AUX 1</td><td>Лівий елерон</td></tr><tr><td>AUX 2</td><td>Правий елерон</td></tr><tr><td>AUX 3</td><td>Elevator</td></tr><tr><td>AUX 4</td><td>Rudder</td></tr><tr><td>AUX 5</td><td>Throttle</td></tr></tbody></table><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Напрямок сервоприводу можна змінити за допомогою параметрів PWM_REV у групі PWM_OUTPUT програми QGroundControl (вкладка з шестернею, останній пункт у лівому меню)</p></div><p>Для подальших інструкцій щодо проводки та налаштувань дивіться: <a href="./../config_vtol/vtol_quad_configuration.html">Стандартна Проводка та Налаштування VTOL</a></p><h2 id="конфігурація" tabindex="-1">Конфігурація <a class="header-anchor" href="#конфігурація" aria-label="Permalink to &quot;Конфігурація&quot;">​</a></h2><p>Налаштуйте рамку, як показано внизу в QGroundControl (не забудьте клацнути <strong>Застосувати і перезапустити</strong> у верхній частині).</p><p><img src="'+s+'" alt="QGC - select firmware for standard VTOL"></p><h2 id="підтримка" tabindex="-1">Підтримка <a class="header-anchor" href="#підтримка" aria-label="Permalink to &quot;Підтримка&quot;">​</a></h2><p>Якщо у вас виникли запитання щодо налаштування або конвертації VTOL, будь ласка, відвідайте <a href="https://discuss.px4.io/c/px4/vtol" target="_blank" rel="noreferrer">https://discuss.px4.io/c/px4/vtol</a>.</p>',18),x=[h,c,m];function b(g,f,v,P,k,T){return _(),p("div",null,x)}const w=d(u,[["render",b]]);export{R as __pageData,w as default};
